import React from 'react';
import '../styling/Consulting.css'

const Consulting = () => {
    return (
        <div class="ConsultingPage">
            <style href="Consulting.css"></style>
            <div class="ConsultingTable">
                <div class="ConDisplay" id="ConTitle">
            </div>
            <div id="ConInfo">

            </div>
        </div>

    </div>
    )
}

export default Consulting;
